import Link from "next/link";

const Header = props => {
  return (
    <header className="d-flex space-between align-center">
      <img className="logo" src="/logo/logo-gainz.png" alt="logo-gainz" />
      <nav className="d-flex">
        <Link href="/">
          <a>
            <span className="nav-element">ACCUEIL</span>
          </a>
        </Link>
        <Link href="/paints">
          <a>
            <span className="nav-element d-flex">ART</span>
          </a>
        </Link>
        <span className="nav-element">CONTACT</span>
      </nav>
      <style jsx>
        {`
          header {
            width: 100%;
            letter-spacing: 2px;
            font-weight: bold;
            padding: 20px 40px;
            position: fixed;
            top: 0;
          }
          nav > a:not(:last-child) span {
            width: 100%;
            margin-right: 60px;
          }
          .logo {
            width: 180px;
          }
        `}
      </style>
    </header>
  );
};

export default Header;
